import React, { useState } from "react";
import { Grid } from "@mantine/core";
import Layout from "./Layout";
import Layout2 from "./Layout2";
import Layout3 from "./Layout3";

const Index = () => {

  return (
    <Grid>
      <Grid.Col span={4}>
        <Layout />
      </Grid.Col>
      <Grid.Col span={4}>
        <Layout2 />
      </Grid.Col>
      <Grid.Col span={4}>
        <Layout3 />
      </Grid.Col>
    </Grid>
  );
};

export default Index;
